import React from "react";

function LogoutPopup(props) {

    function insidePopup() {
        return (
            <div className="popup">
                <div className="popup-inner">
                    <p>Are you sure you want to log out?</p>
                    <br></br>
                    <table>
                        <tr>
                            <td><button type="button" className="btn btn-success">Log Out</button></td>
                            <td><button type="button" className="btn btn-danger popup-close-button" onClick={() => props.closePopup(false)}>Close</button></td>
                        </tr>
                    </table>
                </div>
            </div>
        )
    }

    return (
        <div>
            {props.openPopup ? insidePopup() : null}
        </div>
    )
}

export default LogoutPopup;
